import * as React from "react";
import ReactDOM from "react-dom";
import { Container } from "@mui/material";
import { Toolbar } from "@mui/material";
import { AppBar } from "@mui/material";
import { IconButton } from "@mui/material";
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import { data } from "../components/dataGoots"



export function MainPage() {
  return (
    <>
      <AppBar position="fixed">
        <Container fixed>
          <Toolbar>
              <IconButton edge="start" 
              color="inherit" aria-label="menu">

              <Typography variant="h6">Shop</Typography>               
              </IconButton>
              <Box mr={3}>
                  <Button color="inherit" variant="outlined">Loge in</Button>
              </Box>
              <Button color="secondary" variant="contained">Sing Up</Button>
          </Toolbar>
        </Container>
      </AppBar>

<div>
  <spsan>{data.id}</spsan><br/>
  <spsan>{data.name}</spsan><br/>
  <img src={data.photo}></img>

</div>


    </>
  );
}
